import React from 'react'
import { Link } from "react-router-dom";

 const SignUp = () => {
    const handleSubmit = (e) =>{
        e.prevenDefault();
    }
  return (
    <>
      <form onSubmit={handleSubmit}>
          <h3>Sign up</h3>
          <input type="text" placeholder='Name'/><br/>
          <input type="text" placeholder='Email'/><br/>
          <input type="password" placeholder='Password'/><br/>
          <input type="checkbox"  Send me a weekly mix of handpicked projects plus occasional Kickstarter news  />
          <input type="checkbox" Contact me about participating in Kickstarter research/>
          <button>Create account</button>
      </form>
        <Link to="/login"><button>Redirect to Login</button></Link>
    </>
  )
}
export default SignUp;
